Socjologia – nauka badająca w systematyczny sposób funkcjonowanie i zmiany społeczeństwa. Socjologowie badają społeczne reguły (normy), procesy i struktury, które łączą i dzielą ludzi, tworzą lub są przejawem więzi między ludźmi, a także proces ich zmian. Badają zarówno jednostki uwikłane w grupy społeczne, jak i międzyludzkie relacje (na przykład rodzinę, wspólnoty, stowarzyszenia, zrzeszenia). Relacje międzyludzkie ujęte w społecznej dynamice mogą ludzi łączyć, tworząc grupy społeczne, instytucje czy całe społeczeństwa, lub dzielić przez społeczne podziały. Już w starożytności istniała na wysokim poziomie ogólnie pojęta myśl społeczna. Socjologia jako nauka o społeczeństwie miała trzech ojców. Pierwszym (w europejskim kręgu kulturowym) był Platon, następnie Giambattista Vico oraz, tak powszechnie uznawany za jedynego, Auguste Comte. Przedmiotem badań nauki o społeczeństwie jest grupa społeczna ujęta w kategoriach stanu i zmiany. Socjologowie badają jednostki o tyle, o ile są one w pewnych wewnętrznych relacjach między sobą. Jednostka jako indywiduum nie jest przedmiotem badań socjologii, a zajmuje się nią psychologia. Pod koniec XIX wieku następowały gwałtowne przemiany w łonie europejskich społeczeństw preindustrialnych. Doprowadziły do powstania społeczeństwa industrialnego. Obecnie mówi się o początkach ery społeczeństw postindustrialnych. Narodziny socjologii wiążą się z tymi gwałtownymi zmianami społecznymi, stąd wielu teoretyków uważa, że głównym przedmiotem badań socjologii są nowoczesność i społeczeństwo przemysłowe. Efekty zastosowań socjologii i badań socjologicznych można zaliczyć do trzech kategorii: 
* budzenie, ujawnianie uprzednio niedostrzeganej problematyki; 
* wskazywanie na możliwości wywoływania skutków długofalowych; 
* wskazywanie bezpośrednich, a dotąd nieznanych możliwości zastosowawczych. Socjologia jest wykładana jako przedmiot akademicki na wielu kierunkach studiów oraz funkcjonuje jako oddzielny kierunek studiów na wielu uczelniach w Polsce. W 2018 roku dyscyplina socjologia została przemianowana na "nauki socjologiczne" w .
